import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { EnvelopeIcon, LockClosedIcon } from '@heroicons/react/24/outline';
import './Login.css';
import girl from './images/sitting-2.png';
import ellipse from './images/Ellipse 1.png';
import avatar1 from './images/1.png';
import avatar10 from './images/10.png';
import avatar11 from './images/11.png';
import avatar12 from './images/12.png';
import avatar13 from './images/13.png';
import avatar14 from './images/14.png';
import avatar15 from './images/15.png';
import avatar16 from './images/16.png';
import avatar17 from './images/17.png';
import avatar20 from './images/20.png';
import avatar21 from './images/21.png';
import avatar23 from './images/23.png';

export default function Login({ setIsAuth }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [msg, setMsg] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/login', { username, password });
      console.log('Login response:', res.data);
      localStorage.setItem('token', res.data.token);
      setIsAuth(true);
      navigate('/home');
    } catch (err) {
      setMsg(err.response?.data?.message || 'Error');
    }
  };

  return (
    <div className="login-page">
      <div className="login-left">
        <div className="login-content">
          <h1 className="welcome-message">Welcome Back</h1>

          <form onSubmit={handleLogin}>
            <div className="form-group">
              <div className="input-with-icon">
                <EnvelopeIcon className="input-icon" />
                <input 
                  id="email"
                  type="email" 
                  placeholder="Email" 
                  value={username} 
                  onChange={e => setUsername(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <div className="form-group">
              <div className="input-with-icon">
                <LockClosedIcon className="input-icon" />
                <input 
                  id="password"
                  type="password" 
                  placeholder="Password" 
                  value={password} 
                  onChange={e => setPassword(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <Link to="/resetPassword" className="forgot-password">
              Forgot Password?
            </Link>

            <button type="submit" className="login-btn">Log in</button>
          </form>

          <div className="signup-link">
            Don't Have an Account? <Link to="/register">Sign up</Link>
          </div>

          {msg && <div className="error-message">{msg}</div>}
        </div>
      </div>

      <div className="login-right">
        <div className="image-container">
          {/* Girl in the middle */}
          <img src={girl} alt="Girl sitting" className="sitting-girl" />

          {/* Ellipse at the base near her feet */}
          <img src={ellipse} alt="Ellipse" className="ellipse-base" />

          {/* Individual avatars spread around */}
          <img src={avatar1} alt="Avatar 1" className="avatar-individual avatar-1" />
          <img src={avatar10} alt="Avatar 10" className="avatar-individual avatar-10" />
          <img src={avatar11} alt="Avatar 11" className="avatar-individual avatar-11" />
          <img src={avatar12} alt="Avatar 12" className="avatar-individual avatar-12" />
          <img src={avatar13} alt="Avatar 13" className="avatar-individual avatar-13" />
          <img src={avatar14} alt="Avatar 14" className="avatar-individual avatar-14" />
          <img src={avatar15} alt="Avatar 15" className="avatar-individual avatar-15" />
          <img src={avatar16} alt="Avatar 16" className="avatar-individual avatar-16" />
          <img src={avatar17} alt="Avatar 17" className="avatar-individual avatar-17" />
          <img src={avatar20} alt="Avatar 20" className="avatar-individual avatar-20" />
          <img src={avatar21} alt="Avatar 21" className="avatar-individual avatar-21" />
          <img src={avatar23} alt="Avatar 23" className="avatar-individual avatar-23" />
        </div>
      </div>
    </div>
  );
}
